/** @format */

import React from 'react';

import { Button, TextField, Paper, Grid, ToggleButton } from '@mui/material';

import { useToggle } from '../../context/useToggle';
import { connect } from 'react-redux';

const Profile = ({ user }) => {
  const [open, setOpen] = useToggle(false);

  return (
    <>
      <>
        <Grid container m={5}>
          <Grid item xs={4}>
            <TextField
              margin="normal"
              variant="outlined"
              lable="Username"
            ></TextField>
            <TextField variant="outlined" lable="Mobile #"></TextField>
            <TextField variant="outlined" lable="Phone #"></TextField>
          </Grid>
          <Grid item xs={4}>
            <TextField variant="outlined" lable="Email"></TextField>
            <TextField variant="outlined" lable="State"></TextField>
            <TextField variant="outlined" lable="City"></TextField>
          </Grid>
          <Grid item xs={4}>
            <TextField variant="outlined" lable="Language"></TextField>
            <ToggleButton value="bold" aria-label="bold">
              Willing to Locate
            </ToggleButton>
            <ToggleButton value="bold" aria-label="bold">
              Search Type Active/ Passive
            </ToggleButton>
          </Grid>
        </Grid>
      </>
    </>
  );
};
const mapStateToProps = (state) => ({
  // isAuthenticated: state.auth.isAuthenticated,
  user: state.auth.user,
});

export default connect(mapStateToProps)(Profile);
